import React from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import './App.css';

import About from "./pages/about"

function App() {
  return (
    <Router>
      <div>
        {/* <Nav /> */}
        <Switch>
          <Route exact path={"/"}>
            <About/>
          </Route>

        </Switch>
      </div>
    </Router>
  );
}

export default App;
